import React from "react"
import { Formik, Form, Field, ErrorMessage} from 'formik'

function Patient() {
 
  return (
    <div className="FormPage">
      <Formik > {}
        <Form>
          <Field 
          id='inputForm' 
          name='first_name' //Name must match db name
          placeholder='First Name Here'
          />
        </Form>
      </Formik>
    </div>
  );
}

export default Patient;
